from concurrent.futures import Executor
import array
import asyncio

import numpy as np
from rdp import rdp

from notool.utils import start_generator


class RdpDecimateSeries:
    def __init__(self, x_typecode: str = 'f', y_typecode: str = 'f', chunk_size: int = 1000,
                 epsilon=0.0, threshold=0.0, *, loop=None, pool=None):
        self.x = array.array(x_typecode)
        self.y = array.array(y_typecode)
        self.epsilon = epsilon
        self.threshold = threshold
        self.chunk_size = chunk_size
        self._force_processing = False
        self._freeze = False
        self._head_size = 0
        self._tail_size = 0
        self._in_process_size = 0
        self._loop: asyncio.AbstractEventLoop = loop
        self._pool: Executor = pool

    def copy(self, *, chunk_size=None, epsilon=None, threshold=None, freeze=False):
        object_copy = RdpDecimateSeries(self.x.typecode, self.y.typecode, chunk_size or self.chunk_size,
                                        epsilon or self.epsilon, threshold or self.threshold,
                                        loop=None if freeze else self._loop,
                                        pool=None if freeze else self._pool)
        object_copy.x = self.x
        object_copy.y = self.y
        if freeze:
            object_copy._freeze = True
        else:
            object_copy._tail_size = len(self.x)
        return object_copy

    def append(self, x, y):
        if not self._freeze:
            self.x.append(x)
            self.y.append(y)
            self._tail_size += 1
            self._check_for_processing()

    def extend(self, x, y):
        if not self._freeze:
            self.x.extend(x)
            self.y.extend(y)
            self._tail_size += len(x)
            self._check_for_processing()

    @property
    def freeze(self):
        return self._freeze and not self._in_process_size

    def processing_done(self):
        return self._loop.create_task(self._processing_done()) if self._loop else \
            not self._in_process_size

    # TODO реализовать другую логику ожидания завершения
    async def _processing_done(self):
        while self._in_process_size:
            await asyncio.sleep(0.1)

    def force_processing(self, freeze=True):
        if not self._freeze:
            self._force_processing = True
            self._freeze = freeze
            self._check_for_processing()

    def _check_for_processing(self):
        if not self._in_process_size and (self._tail_size >= self.chunk_size or self._force_processing):
            self._force_processing = False
            self._in_process_size = self._head_size + self._tail_size
            self._tail_size = 0
            args = (self.x, self.y, self._head_size, self._in_process_size,
                    self.epsilon, self.threshold)
            if self._loop:
                self._loop.create_task(self._processing_task(*args))
            else:
                self._processing_completion(*self._processing(*args))

    def _processing_completion(self, x, y):
        self._head_size = len(x)
        if self._tail_size:
            x.extend(self.x[-self._tail_size:])
            y.extend(self.y[-self._tail_size:])
        self.x = x
        self.y = y
        self._in_process_size = 0

    async def _processing_task(self, *args):
        x, y = await self._loop.run_in_executor(self._pool, self._processing, *args)
        self._processing_completion(x, y)
        if self._freeze:
            self._loop = None
            self._pool = None
        else:
            self._check_for_processing()

    @staticmethod
    def _processing(x, y, head_size, in_process_size, epsilon, threshold):
        @start_generator
        def threshold_generator(index):
            previous = y[index]
            while True:
                index = yield previous
                current = y[index]
                previous = current if abs(current - previous) > threshold else previous

        head_size = head_size - 2 if head_size >= 2 else head_size
        y_getitem = threshold_generator(head_size).send if threshold else y.__getitem__
        tail = ((x[index], y_getitem(index)) for index in range(head_size, in_process_size))

        tail = np.fromiter(tail, dtype=np.dtype((float, 2)))    # TODO dtype определять по коду в array.array
        tail = rdp(tail, epsilon=epsilon)
        x_tail, y_tail = np.split(tail.T, 2)
        x, y = x[:head_size], y[:head_size]
        x.extend(x_tail.flat)
        y.extend(y_tail.flat)
        return x, y

    def __len__(self):
        return len(self.x)


